  const [open, setOpen] = React.useState(true);

  const toggleOpen = () => {
    setOpen(!open);
  };

  return (
    <div className="div">
      <button className="open" onClick={toggleOpen}>
        Open CODE
      </button>
    </div>
  );
}

export default App;
